css:
:root {
  font-size: 16px;
}
.slick-header.ui-state-default,
.slick-headerrow.ui-state-default {
  width: 100%;
  overflow: hidden;
  border-left: 0px !important;
}
.slick-header-columns,
.slick-headerrow-columns {
  position: relative;
  white-space: nowrap;
  cursor: default;
  overflow: hidden;
}
.slick-header-column.ui-state-default {
  position: relative;
  display: inline-block;
  overflow: hidden;
  text-overflow: ellipsis;
  height: 16px;
  line-height: .8em;
  font-size: 0.8rem;
  margin: 0;
  padding: 4px;
  border: rgba(0, 0, 0, 0.1) solid 1px;
  border-left: 0px;
  border-top: 0px;
  border-bottom: 0px;
  float: left;
}
.slick-headerrow-column.ui-state-default {
  padding: 4px;
}
.slick-sort-indicator {
  display: inline-block;
  width: 8px;
  height: 5px;
  margin-left: 4px;
}
.slick-sort-indicator-desc {
  background: url("atom://bottom-dock/images/sort-desc.gif");
}
.slick-sort-indicator-asc {
  background: url("atom://bottom-dock/images/sort-asc.gif");
}
.slick-resizable-handle {
  cursor: ew-resize;
  display: block;
  font-size: 0.1px;
  height: 100%;
  position: absolute;
  right: 0;
  top: 0;
  width: 4px;
}
.grid-canvas {
  position: relative;
  outline: 0;
}
.slick-row.ui-widget-content,
.slick-row.ui-state-active {
  position: absolute;
  border: 0;
  width: 100%;
}
.slick-row.ui-widget-content:hover,
.slick-row.ui-state-active:hover {
  background: #313131;
}
.slick-cell,
.slick-headerrow-column {
  position: absolute;
  overflow: hidden;
  text-overflow: ellipsis;
  vertical-align: middle;
  z-index: 1;
  padding: 1px 2px 2px 1px;
  margin: 0;
  white-space: nowrap;
  cursor: pointer;
}
.slick-group-toggle {
  display: inline-block;
}
.slick-cell.highlighted {
  -webkit-transition: all 0.5s;
  -moz-transition: all 0.5s;
  transition: all 0.5s;
}
.slick-cell.flashing {
  border: 1px solid red !important;
}
.slick-cell.editable {
  z-index: 11;
  overflow: visible;
  border-color: black;
  border-style: solid;
}
.slick-cell:focus {
  outline: none;
}
.slick-reorder-proxy {
  display: inline-block;
  opacity: 0.15;
  cursor: move;
}
.slick-reorder-guide {
  display: inline-block;
  height: 2px;
  opacity: 0.7;
}
.slick-selection {
  z-index: 10;
  position: absolute;
  border: 2px dashed black;
}
.ui-widget-content {
  border: rgba(0, 0, 0, 0.1) solid 1px;
  background: transparent 50% 50% repeat-x;
}
.ui-widget-header {
  border: rgba(0, 0, 0, 0.1) solid 1px;
  background: #161719 50% 50% repeat-x;
}
.ui-state-default,
.ui-widget-content .ui-state-default,
.ui-widget-header .ui-state-default {
  border: rgba(0, 0, 0, 0.1) solid 1px;
  background: #161719 50% 50% repeat-x;
}
.ui-state-hover,
.ui-widget-content .ui-state-hover,
.ui-widget-header .ui-state-hover,
.ui-state-focus,
.ui-widget-content .ui-state-focus,
.ui-widget-header .ui-state-focus {
  border: 1px solid #999999;
  background: #161719 50% 50% repeat-x;
}
